insert  into `hotel`(`id`,`hotel_name`,`tel`,`address`,`city_id`,`img`,`state`,`star`,`about`,`log`,`lat`,`des`) values (61,'北京雅诗阁来福士中心服务公寓',' 010-84053888','北京市东城区东直门南大街1-2号',1,'Z7-ECTZiakDVO4CjZ',NULL,'','位于北京最具活力的地区 -- 东城区东直门，毗邻市内大量商业、娱乐、购物及餐饮场所。网友评价说“设施不错”。','39.945577','116.439163','　　在北京雅诗阁来福士中心服务公寓，您可以尽情享受豪华而优雅的生活，能时刻感受这里交通的便利。服务公寓位于北京最具活力的地区 -- 东城区东直门，毗邻市内大量商业、娱乐、购物及餐饮场所。<br />　　服务公寓周围环绕着许多文化旅游胜地：著名的簋街（饮食街）近在咫尺。前往被列为联合国教科文组织世界遗产的故宫博物院也仅仅只需要15分钟时间。<br />　　东直门交通枢纽就在服务公寓的对角处，这个交通枢纽是地铁二号线与十三号线的转换站，为您提供贯穿整座城市的便利交通网络。您也能在此交通枢纽搭乘机场快线轨道直接前往北京首都国际机场，路程仅需16分钟。<br />　　服务公寓内也备有不少设施，您可选择在设备完善的健身房内锻炼身体、在恒温游泳池和水力按摩浴池中放松身心，甚至可以在活动室里举办一场鸡尾酒会。高端新颖的生活便利设施、广泛的商务和娱乐器材配备，以及个性化服务时刻为您提供各种生活上的支持。无论您在公寓的任何地方，您都可以通过无线网络连接，自在地上网与全世界相连。<br />　　居住在北京雅诗阁来福士中心服务公寓，您可以随心所欲地按照自己的方式，一边尽情享受生活与工作，一边发现北京的精彩与魅力。<br />'),(62,'北京辽宁大厦',' 010-62589999','北京市海淀区北四环西路甲2号',1,'JhS1_tJn7F0VShEwJ',NULL,'0','位于北四环保福寺桥东南角，距中外闻名的08奥运场馆“鸟巢”仅5分钟车程。网友评价说“位置也不好，房间不错，性价比高，服务也不错”。','39.99054','116.3439','　　北京辽宁大厦位于北京市北四环黄金地段，距有“中国硅谷”之称的中关村信步可至。毗邻著名学府北大清华，距中外闻名的08奥运场馆“鸟巢”仅5分钟车程。地理位置得天独厚，交通十分便捷。<br />'),(63,'北京天安门皇家驿栈酒店',' 010-67017790','北京市东城区前门商业街鲜鱼口巷87号',1,'NNNN2dHz54Uex23NN',NULL,'','','39.902611','116.405889','　　北京前门皇家驿栈酒店位于前门大街鲜鱼口，紧邻北京城中心轴线，原址为老北京老字号著名浴池—兴华池，距离天安门广场咫尺之遥，步行即可前往故宫博物院、王府井步行街、国家大剧院，临近前门交通枢纽，让您的出行更加方便快捷。<br />'),(64,'北京长安街W酒店',' 010-65158855','北京建国门南大街2号',1,'Z7-ECTZxNuCXxWQdZ',NULL,'','位于北京建国门南大街2号。','39.911809','116.443253','　　北京长安街W酒店距离色彩神秘的故宫、充满活力的秀水街市场和举世闻名的天安门广场仅数步之遥，为繁华的市中心使馆区注入了一丝生机和活力，在这里，高端时尚的风格、令人震撼的历史与动感欢快的夜生活热烈齐聚一堂！<br />'),(65,'北京王府半岛酒店',' 010-85162888','北京市东城区王府井金鱼胡同8号',1,'18TRe013M2dmGKeg1',NULL,'5','位于北京市东城区王府井金鱼胡同8号，与故宫、天安门广场及王府井大街仅举步之遥。','39.921608','116.422864','　　北京王府半岛酒店是由半岛酒店集团管理的涉外酒店，位于北京市繁华的王府井商业区，拥有著名的半岛水疗中心、设施齐备的健身中心、荟萃世界知名品牌的半岛精品廊、粤式餐厅凰庭以及融合亚洲风味的西餐厅。酒店525间客房设计现代时尚、装饰华丽。酒店内每一间客房和套间都配备了宽带和无线上网设施以及可控制房内所有电子设施的控制面板。豪华的劳斯莱斯及宝马车队为客人提供机场接送及车辆租用服务。王府半岛酒店以其典雅大气的传统中国建筑风格，成为其所在地的代表建筑。<br />'),(66,'北京临空皇冠假日酒店',' 010-58108888','北京市顺义区天竺府前一街60号',1,'GIGWX47ObDbfJTMv7',NULL,'','官网直销热线:400-830-3766，位于北京市顺义区天竺府前一街60号，距离首都国际机场仅约15分钟车程。','40.069897552331','116.56296876108','　　北京临空皇冠假日酒店地处天竺空港经济开发区，与新国际展览中心咫尺之遥，距离首都国际机场仅约15分钟车程。且酒店毗邻北京最大的高档别墅住宅区，周边配有各种国际风味餐厅。从酒店驱车至望京商务区只需约20分钟，由机场高速驱车约25分钟即可抵达CBD。<br />'),(67,'北京王府井希尔顿酒店',' 010-58128888','北京市东城区王府井东大街8号',1,'Z7SfeZ9Htw4mRTEmZ',NULL,'','地处繁华的王府井商业区，与古皇城——故宫为邻，地铁5号线灯市口站近在咫尺，步行即可到新东安市场。网友评价说“价格很合理，泳池水温很舒服，时尚的”。','39.920743654951','116.41936120721','　　北京王府井希尔顿位于北京最为著名的繁华商业区王府井大街，无论前往高档餐饮，购物，娱乐设施，还是美术馆，公园及旅游观光地等均十分便利。感受中华传统文化与大都市交相辉映的迷人魅力，尽在在北京王府井希尔顿。坐落于北京市中心及旅游胜地，王府井希尔顿地处豪华购物天堂澳门中心，距离天安门和紫禁城仅举步之遥。北京王府井希尔顿旨在为您提供现代化的舒适感受。<br />'),(68,'北京瑰丽酒店',' 010-65978888','北京市朝阳区呼家楼京广中心',1,'Z7-ECTZ6QlcM4LXaZ',NULL,'','位于北京市朝阳区呼家楼一号。','39.92656','116.467213','　　北京瑰丽酒店坐落在北京最繁华的朝阳区。酒店地理位置优越，位于著名的中央商务区（中央电视台大楼对面），紧邻三环路。商务写字楼、豪华购物中心和世界级的娱乐场所近在咫尺。四通八达的地铁线就位于酒店的正下方，距故宫、天安门广场、天坛公园和三里屯等著名景点。<br />'),(69,'北京柏悦酒店',' 010-85671234','北京市朝阳区建国门外大街2号',1,'oEPFzoo4mtGelJPqo',NULL,'0','位于北京中央商务区中心位置，毗邻中国国际贸易中心及外交使馆区。','39.913026','116.465822','　　位于北京CBD中央商务区核心地带的北京柏悦豪华酒店，座落在朝阳区长安街最高大厦北京银泰中心中央主楼，与中国国际贸易中心及中央电视台遥相对望。靠近使馆区、故宫，天安门广场，王府井，秀水街与华贸中心。距离八达岭长城约1.5小时车程。<br />'),(70,'北京长城脚下的公社',' 010-81181888','北京市延庆县水关长城',1,'Z7-ECTZ4vzYy6IAjZ',NULL,'0','由12名亚洲杰出建筑师设计建造的私人收藏的当代建筑艺术作品。网友评价说“环境很好，价格也可观，服务还是不错的”。','40.346561','116.061762','　　位于水关长城脚下，总占地面积8平方公里。由12名亚洲杰出建筑师设计建造的私人收藏的当代建筑艺术作品，是中国第一个被威尼斯双年展邀请参展并荣获“建筑艺术推动大奖”的建筑作品。2005年被美国《商业周刊》评为“中国10大新建筑奇迹”之一。酒店亮点：日本设计师坂茂的家具屋：基于环保理念的“纸屋子”。地基建好后，别墅的建造就算完工，用来承重的是用篦竹为原料的壁橱，取代了墙与柱，而且可以自由组合、重塑空间。<br />　　香港设计师张智强的手提箱：让人联想到魔方，外观酷似空无一物的空壳，其实所有玄机都在“开箱”的一瞬间，包括餐厅、卧室、桑拿屋，都在地面的玄关之下，空间的弹性得到了最大舒展。<br />　　儿童乐园：孩子们可以用环保的纸浆泥塑一个喜羊羊或纸城堡，在蒲蒲兰绘本馆里找一个贴着墙体的圆圈寻找自己的阅读天地。父母在Anantara Spa享受泰式清爽时，自己的孩子并不孤单。<br />　　长城猎奇：从核桃沟上行，20 分钟就能到达被称为“川字第一号”的烽火台，从这里眺望公社是最好的角度。顺长城再徒步1.5 小时，可以看到散落着的城砖，这里是明长城未完成、被迫停工的神奇一段。<br />'),(71,'上海闵行星河湾酒店',' 021-34129999','上海市闵行区都会路3799号',2,'BGMb-yP1jOF5lGs9P',NULL,'0','上海星河湾酒店坐落于金都路与沪金高速交汇处，位于莘庄经济开发区中心地带，紧邻地铁5号线。','31.093952','121.415431','　　上海星河湾酒店坐落于金都路与沪金高速交汇处，位于莘庄经济开发区中心地带，紧邻地铁5号线、漕河泾经济开发区、紫竹经济开发区。与外环高架路相连，距离上海虹桥机场、徐家汇商业区仅25分钟车程，距离上海南站约18分钟，交通便捷。上海星河湾酒店以地中海城堡为蓝本，弥漫着欧洲的宫廷气息。酒店楼高20层，拥有精心设计的跃式套房及行政楼层服务，设有1400平米的国际会议中心和4间140平米多功能会议室、3间特色餐厅、大堂吧、康乐设施、室内外游泳池、水疗SPA等配套设施一应俱全，尽显“细节所在，心意所动”的服务理念。酒店有253间装修精美的客房，每间都配有熨衣设施，浴室，房内保险箱，卫星频道/有线电视，书桌。酒店设有众多娱乐设施，例如：网球场，室外游泳池，spa，游泳池（儿童），室内游泳池，都是放松身心的最佳选择。一流的设施与得天独厚的地理位置都让上海星河湾全套房酒店成为上海旅游的最佳留宿酒店<br />'),(72,'上海外滩悦榕庄',' 021-25091188','上海市虹口区公平路19号',2,'Z7-ECTk85RTfnOynZ',NULL,'0','位于上海市虹口区海平路，与陆家嘴金融贸易区隔江相望，可俯瞰壮丽的浦江两岸及临江1.8公里的葱郁地带。','31.255217939285','121.51169355092','　　欢迎来到上海外滩悦榕庄——一座隐于上海动感都市活力下的桃花源。<br />　　上海外滩悦榕庄坐落于北外滩，酒店与陆家嘴金融贸易区隔江相望，可俯瞰壮丽的浦江两岸及临江1.8公里的葱郁地带。<br />　　在此，尽情体验全新的度假生活风范。坐拥外滩百年风情，与陆家嘴金融贸易区隔江相望；贴心而周到的服务尽享悦榕庄的温馨与热忱，精力充沛地迎接工作的挑战并享受魅力四射的上海夜生活。<br />　　【温馨提示】：为了您和其他的住客都能拥有一个舒适的入住环境，酒店的访客上限为客房4位套房6位，依据政府相关法律规定所有访客逗留最晚至深夜11点。<br />'),(73,'上海东方商旅精品酒店',' 021-63200088','上海市黄浦区金陵东路1号(中山东二路)',2,'NNNN2dN40tGVb8znN',NULL,'','融合现代简约与上海1930，坐拥外滩纵享浦江盛景。网友评价说“视野很是开阔”。','31.237233705683','121.49960477245','　　东方商旅树立在外滩的建筑群里，低调入口向内穿过充满古董收藏的隧道引向通往大厅的电梯，所有藏品均有商旅主人刘季强先生精心收藏并特邀好友吴宗岳根据自己的理念设计改建。<br />　　东方商旅前身为1860年代美国人罗塞尔设立的旗昌洋行。酒店秘闻：东方商旅中的每一件古董收藏，每一个房间的布局以及每一个细节及设施的成型都承载着东方商旅主人台湾商旅董事长刘季强先生的心血，客房内囊括小酒吧及储物等功能的百宝箱根据主人的概念设计长达3年，室内的所有布局都由主人好友名设计师吴宗岳先生执笔，所有客房都以浦江两岸美景和精美陈设逢迎天下客，酒店处处散发着精致独到与细腻贴心的服务理念。<br />　　范玮琪和黑人在此蜜月，王力宏对靓上海套间屡住不爽。<br />'),(74,'上海北上海大酒店',' 021-56653333','上海市静安区江场西路277号（近万荣路）',2,'JhS1_tJ41umtxkm4J',NULL,'','','31.303813','121.449313','　　北上海大酒店位于江场西路277号（近万荣路），建筑面积17000㎡，由上海市北高新（集团）有限公司投资建设，上海市北商务服务有限公司经营管理，以“环保、绿色、节能、高科技、自然”为设计宗旨，典雅大气，定位为精品商务酒店，是市北高新旗下高品质商务服务平台新力作。酒店位于上海市北高新技术服务业园区内，毗邻大宁国际商圈，邻近地铁1号线、7号线及数十条公交线路，通达八方。酒店拥有165间客房，配备大堂吧、全日制自助餐厅、日式餐厅、酒吧、宴会厅、商务中心、茶室、棋牌室、桌球房、饼屋等设施，并与咫尺之遥的市北高新商务中心（原市北半岛商务会所）融汇互通，为往来宾客提供精致中餐、康体健身、东南亚高端SPA等多方位服务。北上海大酒店项目顺应地理优势，填补区域空白，引入自然、人文、科技气息，聘请经验丰富的高星级服务管理团队，结合精品酒店的定位营造一个独一无二的新潮商务商旅生活。酒店拟以其优雅安逸的环境与发自内心的殷勤待客之道，期待各位的莅临。<br />'),(75,'上海南桥绿地铂骊酒店',' 021-37191999','上海市奉贤区南桥环城东路473号',2,'Z7SQ4Z90Dg7e5ccGZ',NULL,'','位处上海市奉贤区南桥环城东路473号，占尽地利之便，邻近主要交通干道，距离虹桥国际机场只需约30分钟车程。','30.948088','121.466868','　　上海南桥绿地铂骊酒店（原上海南桥绿地逸东华酒店）为旅客缔造一种豪华而不繁复，简洁而不简单的住宿新体验。酒店坐落在上海奉贤区南桥的心脏地带，南桥是上海南区的全新商业中心，交通便利，无论是通往上海其他地区，或是到虹桥或浦东国际机场，都非常方便。<br />'),(76,'上海雅客瑞园行政公寓',' 021-68881521','上海市浦东新区浦东大道3号(近东方明珠)',2,'NNNN2dNbZlNsAY_0N',NULL,'','地处陆家嘴金融贸易区，毗邻东方明珠电视塔。网友评价说“房间还是不错的，前台不是很热情”。','31.245698589503','121.51759537482','　　上海雅客瑞园行政公寓是置鼎酒店管理集团旗下的豪华式5星级酒店公寓，酒店拥有各类套房，座落于闻名遐迩的浦东陆家嘴金融贸易区的中心，距离浦西外滩市中心只需10分钟路程，离上海浦东国际机场也只有30分钟的车程，步行即可至上海东方明珠电视塔和上海海洋水族馆，酒店依傍风景秀丽的黄浦江畔，黄浦江全景尽收眼底。面朝集金融、购物、娱乐于一体的上海商业中心，四周高尚的环境使其成为完美生活的卓越典范。<br />　　上海雅客瑞园酒店公寓中的每一间公寓均配有设备齐全的厨房。公寓内宽敞的用餐区域与拥有最先进的家庭娱乐系统的起居室分开，舒适的大床房我们高效的商务支持服务及个性化的客房服务诠释着您对完全私人空间和宾至如归的感悟。<br />　　经过一天漫长的工作，闭路电视监控系统及执勤的保安员，24小时确保您居住环境的安全。卸下利禄战衣时又可以随情随意地去健身、桑拿、按摩及享受中西美食。享受四季如春的室内泳池，和朋友一起在室内的网球场打球或在设备齐全的健身房内健身，还可以在休闲区认识更多的邻居。<br />　　商务中心的专业秘书服务让您紧握商机脉搏，随传随到的专车和专人邮递服务更让您先拨商务头筹。<br />'),(77,'上海金茂君悦大酒店',' 021-50491234','上海市浦东新区世纪大道88号',2,'JhS1_thxJaojMiVMJ',NULL,'5','位于上海市浦东新区世纪大道88号，毗邻东方明珠、上海环球金融中心，距离上海虹桥国际机场约30分钟车程，上海火车站约20分钟车程。','31.240881427917','121.51248994622','　　上海金茂君悦大酒店位于上海地标——88层金茂大厦的53-87层，是世界最高星级酒店之一。上海金茂豪华酒店地处浦东商业金融区陆家嘴中心，拥有可提供全套服务的商务中心。君悦酒店距离上海证券交易所、上海环球金融中心和国际会议中心仅咫尺之遥。<br />'),(78,'上海国际精英俱乐部盛世会别墅',' 021-33686888','上海徐汇区建国西路568号，靠近乌鲁木齐南路',2,'JhS1_tJvQPzA9St-J',NULL,'0','位于上海市徐汇区建国西路，交通便利。','31.209124999028','121.45660500114','　　御席公馆邀您来享受老上海原法租界的奢华、宏伟和个性化的服务。作为英国传教士的私人府邸，御席建于1926年，是上海首屈一指的五星级精品酒店。如果您渴望在私密、高雅的氛围中体验老上海的历史和文化，御席公馆将是您最好的选择。 最繁华的原上海法租界核心区域，御席公馆位于拥有悠久历史的建国西路上，步行十分钟即可到达上海著名的购物商业区徐家汇和充满活力的衡山路酒吧街。地铁1、7和9号线近在咫尺，搭乘地铁您能快捷的到达上海的任何地方。 御席公馆的15间套房体现了十六世纪法式复古的魅力和风格，体贴入微的服务和温馨的氛围，将使您找不到任何现代上海的痕迹。在一个高雅独特的十六世纪法国主题公馆内，每间套房的设施为您提供了舒适的享受和现代化的便利。 我们欢迎您和您的家人、朋友一起来御席公馆体验老上海的浪漫和法式的优雅。<br />'),(79,'上海首席公馆酒店',' 021-54039888','上海徐汇区新乐路82号，靠近襄阳北路',2,'JhS1_t5WwGVIQNd7J',NULL,'','中国第一家城市文化遗产精品酒店，曾是青帮教父杜月笙公馆。','31.224102','121.461689','　　&quot;公馆建筑建于1932年，最初为私人别墅，是由当时法国著名设计师拉法尔设计。它左右对称、构图规整，有古典主义构图意象。<br />　　整座建筑风格具体地体现了当时拥有社会地位的历史名人气派，同时也蕴涵着丰富的历史文化气息。后来，这里成为了当时上海滩风云人物黄金荣、杜月笙和金廷荪等人合股成立的三鑫公司的办公地点。解放后，华东交通部入驻此宅；1958年成为上海市交通运输局办公楼，近几年一直处于空置状态。<br />　　酒店亮点：300余件老上海珍贵文物：1910年的手摇留声机；上世纪30年代的各类财务票据、银行票据、股票、地契等旧上海金融藏品；美女香烟广告；老式照相机、电影放映机；瓦斯热水炉。5.5米高的层高：客房楼层的层高达到5.5米，通常酒店的层高达到4米就不错了，可见旧时“大户人家”的作派。5楼的skyline西餐厅：如果天气适宜，可在露台用餐，对面是古俄罗斯风格的东正教堂，五个鼓形穹顶，孔雀蓝与奶白色相间。&quot;<br />'),(80,'上海外滩华尔道夫酒店',' 021-63229988','上海市黄浦区中山东一路2号',2,'JhS1_tJi_cPpVOUjJ',NULL,'','位于上海外滩核心地带，上海市黄浦区中山东一路2号，毗邻南京路步行街、人民广场。','31.239275','121.496313','　　上海外滩华尔道夫酒店是一座拥有丰富文化内涵、传奇色彩、恒久建筑与深厚历史的奢华酒店，为您创造真实、难忘、独特的体验。它完美结合了上海外滩闻名遐迩的历史与文化及二十一世纪的繁华。<br />　　在分期开业的两幢楼的综合大楼里，设置环境现代时尚的餐厅和酒吧，可俯瞰上海城市美景的精美华贵的宴会厅，豪华的水疗中心，设施完备的健身房等，各功能设置精致巧妙，构成一幅完美的图画，展示出只属于上海外滩华尔道夫酒店的独一无二的宏伟和精致。这里极享盛名的风格，周到的服务，引人注目的周边环境，必将给尊贵的您带来一场休闲度假或商务旅行的独特体验。<br />'),(81,'广州长隆酒店',' 020-84786838','广州市番禺区番禺大道',3,'nz078uvZFZ8TNIFUv',NULL,'','地处中国5A级精品景区——长隆旅游度假区的中心地段，拥有全中国唯一放养白虎及火烈鸟的中庭花园。网友评价说“交通方便，环境不错，价格偏贵，服务很好，房间离电梯超远，早餐很好”。','23.008192','113.334409','　　广州长隆酒店是长隆集团倾力打造全新国际水平的超大型会议休闲度假酒店，地处中国5A级精品景区——长隆旅游度假区的中心地段，总建筑面积达36万平方米，拥有融入不同生态意念的特色客房及套房，约三万平方米的国际会展中心，内设两个分别为6000平方米无柱和900平方米的宴会大厅，以及39间由1200㎡-60㎡可作不同用途的多功能会议厅房。广州长隆酒店左揽长隆欢乐世界，右依香江野生动物世界，前拥长隆高长隆高尔夫练习中心，后傍广州鳄鱼公园，与长隆水上乐园及长隆国际大马戏为邻；酒店更拥有全中国唯一放养白虎及火烈鸟的中庭花园，咫尺之隔饱览大自然的奇妙造化，让您亲身体会非洲草原的自然气息。<br />'),(82,'广州增城金叶子温泉度假酒店',' 020-82829999','广州增城市白水寨风景名胜区',3,'dEakD-_2utwQTDlB-',NULL,'5','位于增城市白水寨风景名胜区。网友评价说“地理位置环境一流，环境不错，房价稍高，服务也很好，早餐丰富”。','23.571129','113.793177','　　金叶子度假酒店是以高山温泉养生及水疗为主题，并集餐饮、住宿、会议、康体、娱乐等多功能于一体的休闲度假酒店。酒店巍然屹立于山体的半山腰处，融汇了中式和独特的巴厘岛式建筑风格。低密度的建筑规划，为客人提供大量户外活动及休闲空间；开放式落地窗户，让您远眺群峰连绵，近观万亩田园；楼宇之间绿树花草簇拥，溪水长流，美的令人窒息……酒店温泉池区拥有36个大小不同的温泉泡池，且位于高山之上，因而得名高山温泉，它是广东省内目前海拔最高的温泉。水源来自深藏的地热温泉，底下水温高达75摄氏度，色泽透明，属极软的弱碱性温泉，富含偏硅酸、钠、锌、铜、钙等对人体健康有益的微量元素，是祛病保健、美容护肤的最佳天然泉水<br />'),(83,'广州花园酒店',' 020-83338989','广州市越秀区环市东路368号',3,'Z7SMfZ9rqhLu9nEtZ',NULL,'5','坐落于越秀区环市东路368号，毗邻市内各大观光购物和休闲娱乐热点。网友评价说“交通方便，环境很好，价格比较高，服务不错，地理位置好，早餐也不错”。','23.141389615955','113.29270761246','　　广州花园酒店是中国首批三家之一、华南地区唯一的&quot;白金星级&quot;酒店以及岭南集团高端豪华酒店品牌&quot;LN岭南花园酒店&quot;的旗舰店，也是第16届广州亚运会总部饭店。酒店以一流的设施、优质的服务和独特的岭南文化氛围著称，是中外商旅下榻之首选。花园酒店位于广州市中心繁华商业区，交通便利，毗邻市内各大观光购物和休闲娱乐热点，广州地铁5号线淘金站更是近在门前。酒店装饰富丽堂皇，拥有828间豪华舒适的客房以及多间荟萃环球风味美食的特色餐厅和酒吧。现代华丽的国际会议中心和10间多功能宴会厅，配套设施一应俱全，是宴请宾客，举办会议的理想场所。此外，酒店还设有商务中心、健康中心、水疗中心、购物商场和后花园等其它多项设施，为来自世界各地的宾客提供宾至如归的尊贵服务。<br />'),(84,'广州南丰朗豪酒店',' 020-89163388','广州市海珠区新港东路638号（近新港东地铁站F出口）',3,'Z7-ECTkOsis9DC0HZ',NULL,'0','位于广州市海珠区新港东路，连接地铁站入口，交通便捷，','23.102465','113.366759','　　广州南丰朗豪酒店距离广交会展馆步行仅需约2分钟。酒店交通便捷，距离新港东地铁站仅有约5分钟步行路程，珠江新城约15分钟车程，白云国际机场约45分钟车程，从酒店可轻松抵达购物商圈以及各个主要景点。酒店隶属于朗廷酒店集团。朗廷酒店集团的璀璨瑰丽传奇始于1865年，当时伦敦朗廷酒店隆重开业，成为欧洲首家豪华酒店。时至今日，世界各地的朗廷酒店仍然坚守相同的理念，把典雅高贵的设计、创新的待客之道、触动五官的感觉及体贴挚诚的服务完美结合，呈现客人眼前。酒店时尚、轩敞的客房均配备顶级设备，为您每一次下榻缔造舒心的居停体验。独具风格的餐厅和酒吧供应环球自助餐、各种地道美食和美酒，呈献出滋味无穷的美味盛宴。酒店坐拥气派非凡的宴会及会议场地，其中包括宴会厅、五个会议室、户外活动场地，以及无柱式大宴会厅，为各种规模的活动提供足够的空间和灵活性。此外，为满足宾客的健康和养生需求，酒店设有卓越完善的健身休闲设施，包括「川」水疗中心、健身室、室内恒温游泳池以及两个迷你高尔夫球场。<br />'),(85,'adfadsfa','','',NULL,'u=4236942158,2307642402&fm=116&gp=0',NULL,'',NULL,NULL,NULL,NULL),(86,'1212','','',NULL,'u=4271053251,2424464488&fm=116&gp=0',NULL,'',NULL,NULL,NULL,NULL),(87,'测试图片','010-6456','不告诉你',NULL,'u=4236942158,2307642402&fm=116&gp=0',NULL,'',NULL,NULL,NULL,NULL),(88,'北京大酒店','13888888888','天安门隔壁',NULL,'壁纸',NULL,'7',NULL,NULL,NULL,NULL),(89,'test','13800138000','beijing',NULL,'a1',NULL,'5',NULL,NULL,NULL,NULL),(90,'2222','','',NULL,'6',NULL,'',NULL,NULL,NULL,NULL),(91,'a','','',NULL,'u=4236942158,2307642402&fm=116&gp=0',NULL,'',NULL,NULL,NULL,NULL),(92,'【888','','',NULL,'003wYxc8gy6LrDkweAMc0',NULL,'',NULL,NULL,NULL,NULL),(93,'广东','广东','',NULL,'eeason1',NULL,'',NULL,NULL,NULL,NULL),(94,'a','','',NULL,'u=4236942158,2307642402&fm=116&gp=0',NULL,'',NULL,NULL,NULL,NULL),(95,'群主是猪','','',NULL,'1商城首页_定位_修改',NULL,'',NULL,NULL,NULL,NULL);

